import React from "react";


function Home() {
    let randomColor = Math.floor(Math.random() * 16777215).toString(16);
  return (
    
   
  
    <div className="home">
                
      <div class="container"  className="child-container"
        style={{ backgroundColor: "#" + `${randomColor}` }}>
       
        
          <div class="col-lg-1">
            <img
              //class="img-fluid rounded mb-4 mb-lg-0"
              src="../../assets/welcomImg.png"
              alt=""
            />
          </div>
          <div class="col-lg-5"  className="child-container"
        style={{ backgroundColor: "#" + `${randomColor}` }}>
            <h1 class="font-weight-light">Bienvenue !</h1>
            <p>
            Serveur d'administration des données pour les enquêtes HCERES
            </p>
          </div>
        </div>
      
    </div>
  );
}

export default Home;
